script: |
  super -f text -I q1961.spq | sort > q1961.out

inputs:
  - name: q1961.spq
    data: |
      SELECT - 67 + - 79 - + - ( + + col2 ) + + - col0 * + CAST ( NULL AS INTEGER ) / + col0 / - + 6 * + col1 + - col2 * col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE + col0 = col1 * 57;
  - name: tab2

outputs:
  - name: q1961.out
    data: |
